''' https://leetcode.com/problems/minimum-window-substring/
'''

class Solution:

    def minWindow(self, s, t):
        ''' Trying to do it in linear time
        '''

        # What letters and how many of them we are looking for
        target_count = {}
        for char in t:
            target_count[char] = target_count.get(char, 0) + 1

        # 2 pointers to move along the string
        start = 0
        end = -1 # -1 so it would be 0 on the first iteration

        # Does currect selection has all the letters that target needs
        fit_target = False

        # Letters and their counts we have in the current selection
        current_count = {}

        # Letters (unique) still missing to complete the target
        missing_letters = set(list(t))

        # Smallest substring found so far
        smallest_substring = ""

        while True:

            # Current selection does not fit:
            # move right pointer and chek if it does now
            if not fit_target:
                end += 1

                # This is also where we exit
                if end >= len(s):
                    break

                char = s[end]
                current_count[char] = current_count.get(char, 0) + 1

                if char in missing_letters and current_count[char] == target_count[char]:
                    missing_letters.discard(char)

                if not missing_letters:
                    fit_target = True

            # Current selection contains target letters.
            # Move left pointer and check if it is not longer does
            else:
                char = s[start]
                start += 1
                current_count[char] -= 1

                if char in target_count and current_count[char] < target_count[char]:
                    missing_letters.add(char)
                    fit_target = False

            # Track the smallest substring
            if fit_target:
                if smallest_substring == "" or end - start + 1 < len(smallest_substring):
                    smallest_substring = s[start:end+1]
                    #print(f"MATCH: {s[start:end+1]}")

        return smallest_substring

    def minWindow_v1(self, s, t):
        ''' Find the smallest subsrt in s 
        with all characters from t
        '''

        def find_window_at_position(start, limit):

            # Make a copy of target_dict
            target = {**target_dict}

            # Now knock them out from target
            for pos in range(start, len(s)):

                # Stop if result is already longer than limit
                if 0 < limit < pos - start + 1:
                    return 0

                char = s[pos]
                if char in target:
                    target[char] -= 1
                    if target[char] == 0:
                        del target[char]
                        if not target:
                            return pos + 1
            return 0

        # Make target into dict with counts
        target_dict = {}
        for char in t:
            if char in target_dict:
                target_dict[char] += 1
            else:
                target_dict[char] = 1

        target_set = set(t)
        current_max = ""

        for left, char in enumerate(s):

            # Starting with any character from the target
            if char in target_set:

                # Find the right edge of teh window from this position
                right = find_window_at_position(left, len(current_max))

                # The first, broadest, search faild, no need to continue
                if current_max == "" and right == 0:
                    return ""

                # Keep track of the best found window
                if right > left and 0 < (right - left) < len(current_max) or current_max == "":
                    current_max = s[left:right]

        return current_max

def main():
    ''' Test minWindow
    '''

    solution = Solution()

    test_cases = [
        ("ADOBECODEBANC", "ABC"),
        ("a", "a"),
        ("a", "aa"),
        ("xxxabcabcabcddddxxxxxxxx", "abcd"),
    ]

    for s, t in test_cases:
        result = solution.minWindow(s, t)
        print(f"{s}, {t}: '{result}'")

def large_case():
    start = time.time()
    solution = Solution()
    s = ""
    t = ""

    result = solution.minWindow(s, t)
    elapsed = time.time() - start
    print(f"done, len(s)={len(s)}, len(t)={len(t)}",
          f"len(result)={len(result)}, time: {elapsed}")

if __name__ == "__main__":
    import time
    main()
    large_case()
